const Pedido = () => {
  return (
    <section>
      <Headerpedido />
      <section className={styles.body}>
        <div>
          <p className={styles.titles}>Men√∫</p>
          <Menu />
        </div>
        <div>
          <p className={styles.titles}>Orden</p>
          <Orden />
        </div>
      </section>
    </section>
  );
};

export default Pedido;
